using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using Partiality.Modloader;
using UnityEngine;
using OptionalUI;
using System.Reflection;
using System.Reflection.Emit;
using System.Security;
using System.Runtime.CompilerServices;
using System.IO;
using RWCustom;
using Menu;
using System.Security.Permissions;

[assembly: IgnoresAccessChecksTo("Assembly-CSharp")]
[assembly: SecurityPermission(SecurityAction.RequestMinimum, SkipVerification = true)]
[module: UnverifiableCode]

namespace System.Runtime.CompilerServices
{
    [AttributeUsage(AttributeTargets.Assembly, AllowMultiple = true)]
    public class IgnoresAccessChecksToAttribute : Attribute
    {
        public IgnoresAccessChecksToAttribute(string assemblyName)
        {
            AssemblyName = assemblyName;
        }

        public string AssemblyName { get; }
    }
}

public class RainScript : MonoBehaviour
{
    public static int palettecount = 0;
    public static Downpour mod;
    public static List<string> snowExt1 = new List<string>();
    public static List<string> snowExt2 = new List<string>();
    public void Initialize()
    {
        RainFall.Patch();
        RainPalette.Patch();
        //Load Snow Palette Image
        Downpour.snowTex = new Texture2D(32, 16, TextureFormat.ARGB32, false);
        Downpour.snowTex.anisoLevel = 0;
        Downpour.snowTex.filterMode = FilterMode.Point;
        byte[] snow = Convert.FromBase64String(Downpour.snowData);
        Downpour.snowTex.LoadImage(snow);
        Downpour.snowPileTex = new Texture2D(32, 16, TextureFormat.ARGB32, false);
        Downpour.snowPileTex.anisoLevel = 0;
        Downpour.snowPileTex.filterMode = FilterMode.Point;
        byte[] snowpile = Convert.FromBase64String(Downpour.snowPileData);
        Downpour.snowPileTex.LoadImage(snowpile);
        Downpour.logo = new Texture2D(32, 16, TextureFormat.ARGB32, false);
        Downpour.logo.anisoLevel = 0;
        Downpour.logo.filterMode = FilterMode.Point;
        byte[] logo = Convert.FromBase64String(Downpour.logoData);
        Downpour.logo.LoadImage(logo);
        Downpour.logo2 = new Texture2D(32, 16, TextureFormat.ARGB32, false);
        Downpour.logo2.anisoLevel = 0;
        Downpour.logo2.filterMode = FilterMode.Point;
        byte[] logo2 = Convert.FromBase64String(Downpour.logo2Data);
        Downpour.logo2.LoadImage(logo2);
        //Snow Palette Assignments
        //Ext1 - Bright Palette
        snowExt1.Add("CC");
        snowExt1.Add("HI");
        snowExt1.Add("GW");
        snowExt1.Add("SI");
        snowExt1.Add("SU");
        snowExt1.Add("SL");
        snowExt1.Add("LF");
        snowExt1.Add("UW");
        snowExt1.Add("SB");
        snowExt1.Add("DS");
        snowExt1.Add("AR");
        //Ext2 - Dark Palette
        snowExt2.Add("SH");
        //Regions Without Snow
        //SB
        //DS
    }
    public void Update()
    {
        if (Input.GetKeyDown(KeyCode.Alpha7))
        {
            if (Downpour.snow)
            {
                Downpour.snow = false;
            }
            else
            {
                Downpour.snow = true;
            }
        }
    }
}

public class Downpour : PartialityMod
{
    public Downpour()
    {
        this.ModID = "Downpour";
        this.Version = "v0.5";
        this.author = "LeeMoriya";
    }
    public override void OnEnable()
    {
        base.OnEnable();
        RainScript.mod = this;
        GameObject go = new GameObject();
        script = go.AddComponent<RainScript>();
        script.Initialize();
    }
    public static OptionInterface LoadOI()
    {
        return new DownpourConfig();
    }

    public static RainScript script;
    public static bool paletteChange = true;
    public static bool lightning = true;
    public static bool dynamic = true;
    public static int intensity = 0;
    public static bool rainbow = false;
    public static bool configLoaded = false;
    public static bool debug = true;
    public static bool snow = true;
    public static bool bg = true;
    public static bool water = true;
    public static List<string> rainRegions = new List<string>();
    public static int rainAmount = 50;
    public static int direction = 0;
    public static int rainChance = 75;
    public static bool interiorRain = true;
    public static Texture2D snowTex;
    public static string snowData = "";
    public static Texture2D snowPileTex;
    public static string snowPileData = "";
    public static Texture2D logo;
    public static string logoData = "";
    public static Texture2D logo2;
    public static string logo2Data = "";
}